  [],\n\t\"revision_timestamp\": \"2016-07-27T22:51:22.341886\",\n\t\"name\": \"swan-lake-national-wildlife-refuge-narrative-report-for-january-april-1948\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Swan Lake National
  Wildlife Refuge outlines Refuge accomplishments from January through April of 1948.
  The report begins by summarizing the weather conditions, habitat conditions, water
  conditions, and food and cover during this period. Wildlife- including migratory
  birds, upland game birds, big game animals, furbearers, predators, mammals, rodents,
  \ raptors, fish, and disease- is also covered. The Refuge development and maintenance
  section discusses physical developments, plantings, and collections and receipts.
  Resource management is outlined; topics include timber removal. The public relations
  section of the report describes recreational uses, Refuge visitors, Refuge participation,
  and violations. Items of interest and photographs are attached.\",\n\t\"license_title\":
